import React, { Component } from 'react';
import Bowl from './Ingredients/Bowl';
import Ingredients from './Ingredients/Ingredients';
import classes from './TestUI.module.css';
class TestUI extends Component {
    render() {
        return (
            <div className={classes.container}>


                <div className="inner">
                    <div class="child"><Bowl /></div>
                    <div class="child"><Ingredients imgName='lettuceBGfree.png' /></div>
                    <div class="child"><Ingredients imgName='quinoaBgfree.png' /></div>
                </div>
            </div>
        );
    };
}

export default TestUI;
